import pandas as pd
import json
from pathlib import Path

# ------------------------------------------------------------------
# helper ------------------------------------------------------------
# ------------------------------------------------------------------
def scan_file(file_path, keywords):
    """
    Look for any of the keywords in the column names or the first
    5 000 cells of the dataframe(s) found inside *file_path*.
    Returns True if at least one keyword is found, otherwise False.
    """
    file_path = Path(file_path)
    ext = file_path.suffix.lower()
    kw_lower = [k.lower() for k in keywords]
    found = False

    try:
        if ext == ".csv":
            df = pd.read_csv(file_path, nrows=5000, dtype=str, low_memory=False)
            found = _df_contains(df, kw_lower)
        elif ext in [".xls", ".xlsx"]:
            xl = pd.ExcelFile(file_path)
            for sheet in xl.sheet_names:
                df = xl.parse(sheet_name=sheet, nrows=5000, dtype=str)
                if _df_contains(df, kw_lower):
                    found = True
                    break
        else:
            # unsupported format for this quick scan
            found = False
    except Exception as e:
        # If anything goes wrong (corrupt sheet, unexpected dtype, etc.)
        # we just treat it as "not found" for robustness.
        found = False

    return found


def _df_contains(df, kw_lower):
    # search column names
    cols = " ".join([str(c).lower() for c in df.columns])
    if any(k in cols for k in kw_lower):
        return True

    # search a sample of the data itself (flatten to one long string)
    sample_values = " ".join(
        df.astype(str).fillna("").values.reshape(-1).tolist()[:5000]
    ).lower()
    return any(k in sample_values for k in kw_lower)


