import json
import pandas as pd
import pathlib
import re

# ------------------------------------------------------------------
# Utility functions
# ------------------------------------------------------------------
def csv_contains_keywords(path, keywords):
    """Return True if any keyword appears in the header or the
    first few rows (as strings) of the csv file located at *path*."""
    try:
        df = pd.read_csv(path, low_memory=False, nrows=500)   # read only a sample
    except Exception:
        return False
    s = ' '.join(map(str, df.columns)).lower() + ' ' + \
        ' '.join(df.astype(str).fillna('').agg(' '.join, axis=1).tolist()).lower()
    return any(kw in s for kw in keywords)

def excel_contains_keywords(path, keywords):
    """Return True if any keyword appears anywhere in the workbook."""
    try:
        xl = pd.ExcelFile(path)
    except Exception:
        return False
    for sheet in xl.sheet_names:
        try:
            df = xl.parse(sheet, nrows=500)         # sample first 500 rows
        except Exception:
            continue
        s = ' '.join(map(str, df.columns)).lower() + ' ' + \
            ' '.join(df.astype(str).fillna('').agg(' '.join, axis=1).tolist()).lower()
        if any(kw in s for kw in keywords):
            return True
    return False

