import json
import pandas as pd
from pathlib import Path

# Paths
base = Path("/home/gridsan/elai/Kramabench/data/archeology/input")
files = {
    "worldcities.csv": base / "worldcities.csv",
    "roman_cities.csv": base / "roman_cities.csv",
    "conflict_brecke.csv": base / "conflict_brecke.csv",
    "climateMeasurements.xlsx": base / "climateMeasurements.xlsx",
    "radiocarbon_database_regional.xlsx": base / "radiocarbon_database_regional.xlsx"
}

# Simple heuristic: file has columns that obviously describe cities (e.g., 'city', 'lat', 'lng' etc.)
city_files = []
for name, path in files.items():
    try:
        if path.suffix == ".csv":
            df = pd.read_csv(path, nrows=5)
        elif path.suffix == ".xlsx":
            # Only peek at first sheet
            df = pd.read_excel(path, sheet_name=0, nrows=5)
        else:
            continue
    except Exception:
        continue

    cols = [c.lower() for c in df.columns]
    key_words = ["city", "toponym", "lat", "lng", "latitude", "longitude"]
    if any(any(k in col for k in key_words) for col in cols):
        city_files.append(name)

answers = {
    "subtask-1": city_files,
}

print(json.dumps(answers, indent=4))

